# ###### Defining a SalesOrder class using dataclasses
# https://docs.python.org/3.11/library/dataclasses.html

# CELL ********************

from dataclasses import dataclass   
from dataclasses import field
from typing import List
from typing import Optional

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# CELL ********************

@dataclass
class ItemOptions:
    optionId : int
    optionName: str
    optionValue: str
    optionDescription: str

class Item:
    sku : str
    description : str
    price: float

@dataclass
class Loyalty:
    loyaltyTier: str
    loyaltyPoints: int

@dataclass
class Payment:
    paymentType: str
    amount : float
    annotation: str

@dataclass
class SalesOrder:
    id: str
    storeId: str
    orderNumber: str
    orderDate: datetime
    status: str
    customerId: str
    loyalty : Loyalty
    items: List[Item]
    subtotal:float
    tax: float
    total: float
    payments : List[Payment]
    _rid: Optional[str] = field(default=None)          # not required
    _self: Optional[str] = field(default=None)         # not required
    _etag: Optional[str] = field(default=None)         # not required
    _attachments: Optional[str] = field(default=None)  # not required
    _ts: Optional[int] = field(default=None)           # not required

