# ###### Callback to accumulate all RUs used across all partitions calls

# CELL ********************

total_ru = [0.0] 
total_requests = [0]

def capture_ru(resp):
    # Called for each request/page; sum RU from the response headers
    header = resp.http_response.headers
    total_requests[0] += 1
    if "x-ms-request-charge" in header:
        total_ru[0] += float(header["x-ms-request-charge"])

